import React from 'react';
import Button from "./components/Button/Button.js";
import './App.css';

const images = [
    {
        product: 'Recargas',
        url: '/static/images/grid-list/breakfast.jpg',
    },
    {
        product: 'Recargas',
        url: '/static/images/grid-list/burgers.jpg',

    },
    {
        product: 'Recargas',
        url: '/static/images/grid-list/camera.jpg',
    },
    {
        product: 'Recargas',
        url: '/static/images/grid-list/camera.jpg',
    },
];


function App() {
  return (
    <div className="App">
        {images.map((image) => (
            <Button urlImage={image.url}>Recargas</Button>
        ))}
    </div>
  );
}

export default App;
